import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Flashcard from './Flashcard';

const App = () => {
  return (
    <Router>
      <div>
        <Route exact path="/" component={Flashcard} />
        <Link to="/unit-selection">
          <button>Ä°leri</button>
        </Link>
      </div>
    </Router>
  );
};

export default App;
